import React from 'react';
import classes from './ProfileInfo.module.css'


const ProfileInfo = () => {
    return (
        <div className={classes.content}>
            <div>
                <img
                    src="https://semantica.in/wp-content/uploads/2018/08/av-427845-1.png" alt=""/>
            </div>
        </div>
    );
}

export default ProfileInfo;
